  return (
    <div className="about-me-container">
      <div className="about-me-text">
        <h4 className="about-heading">About Me</h4>
        <h3 className="about-subheading">Hello! I'm David Andrew. I'm a Professional Web Designer & Wordpress Developer & Freelancer.</h3>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Aenean consectetur ut lorem vitae ultricies. Integer porta, libero sit amet pretium lobortis, tortor mauris eleifend urna, ut laoreet velit nisi scelerisque ex. Fusce vel pulvinar ligula. Etiam eget dolor leo. Phasellus eu dolor cursus, sodales nunc at, tempor turpis. Morbi ac ante neque. In porttitor imperdiet blandit. Aliquam laoreet rutrum mattis. Pellentesque id ligula et purus tincidunt tempus a nec purus.</p>
      </div>
      <div className="about-me-cards">
        <Card title="Card 1" description="Description for card 1" />
        <Card title="Card 2" description="Description for card 2" />
        <Card title="Card 3" description="Description for card 3" />
        <Card title="Card 4" description="Description for card 4" />
      </div>
    </div>
  );
};

export default AboutMe;
